measurements.description:
Thirty-six flowers and nine buds on four arching to pendulous inflorescences to 73cm length;
	dorsal sepal hooded, lanceolate, yellow spotted burgundy;
	lateral sepals lanceolate, light yellow, densely spotted burgundy, diffussed burgundy distally;
	petals lanceolate, yellow spotted and blotched burgundy;
	lip yellow, blotched burgundy;	

	column yellow overlaid rose, anther cap cream;


    substance average; texture matte.
